import React, { ReactNode } from "react";
import { ICard, ICardProps } from "../../interFaces/interFaces";
import "./Card.css";

const  Card: React.FC <ICard> = (props: ICard) => {
//   const restProps: ICard | undefined = props?.rest;
  return (
    <>
      <div className="card">
        <section>
        {props.img_rest ? <img className="img-rest food" src={props.img_rest}/> : <img className="img-dish food" src={props.img_dish}/>}
        </section>
        <div className="card-downer-div">
          <h1>{props.name} </h1>
          {props.icons ? props.icons?.map((source:string, index:number)=> <img className="icon" src={source} key={index} alt="icon" />) : null}
          <p>{props.chef ? props.chef : props.about}</p>
            {props.rating ? <img className="rating" src={props.rating} alt="rating"/> : null}
            {props.price ? <div ><hr /><p>â‚ª{props.price}</p><hr /></div> : null }
        </div>
      </div>
    </>
  );
};

export default  Card;
